import React, { useState, useEffect } from "react";
import axios from "axios";

const Kinds = () => {
  const [kinds, setKinds] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:4000/kinds")
      .then((res) => {
        setKinds(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  console.log(kinds);

  return (
    <div>
      <h2>Kinds of Arguments</h2>
      {kinds.map((kind) => (
        <div>
          <h3>{kinds.kind}</h3>
          <p>{kinds.definition}</p>
        </div>
      ))}
    </div>
  );
};

export default Kinds;
